import React from "react";
import './themes.scss';

class Themes extends React.Component {
  render() {
    return (
      <div className="cp-section__themes">
        <h1>Themes</h1>
        <p>Wordpress themes and plugins will be added soon, this is still WIP!</p>
      </div>
    );
  }
}

export default Themes;
